import './App.css';
import './index.js';
import Home from './components/Home.tsx';
import Sheet from './components/Sheet.tsx';
import Budget from './components/Budget.tsx';
import StartPage from './components/StartPage.tsx';
import SavingsGoalProgress from './components/SavingsGoalProgress.tsx';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Routes>
        {/* Define the route for the StartPage (Login page) */}
        <Route path="/" element={<StartPage />} />

        {/* Define route for Home page (overview) */}
        <Route path="/overview" element={<Home />} />

        {/* Define route for Sheet page (input spending) */}
        <Route path="/sheet" element={<Sheet />} />

        {/* Define route for SavingsGoalProgress page */}
        <Route path="/savings-goal" element={<SavingsGoalProgress />} />

        {/* Define route for Budget page */}
        <Route path="/budget" element={<Budget />} />
      </Routes>
    </Router>
  );
}

export default App;
